import React from "react";
import CarouselComponentWeek from "./(utils)/CarouselWeek";

const TrendingThisWeek = () => {
  return (
    <div className="flex flex-col gap-5 pl-10 pt-10 border-2">
      <div className="text-xl font-bold flex flex-row gap-10 items-center">
        <div className="p-1">Trending This Week</div>
      </div>
      <div className="border-2">
        <CarouselComponentWeek />
      </div>
    </div>
  );
};

export default TrendingThisWeek;
